import React, { useContext } from "react";

const Header = () => {
  
    return (
            <div className="card header">
                <div className="col s12 m6">
                <div className="card white waves-light darken-4-text ">
                    <div className="card-content ">
                    <span className="card-title">!ברוכים הבאים</span>
                    <p className="headerText" style={{direction:"rtl"}}>
                    קרה לכם פעם שהייתם צריכים לקדוח חור בקיר ולא היה לכם מקדחה? או לחילופין יצא לכם להסתכל על הפטיפון הישן שלכם ושאלתם מה אני יעשה איתו אולי אני אזרוק וזהו?  Use Mine היא דרך מהפכנית להרוויח כסף נוסף על ציוד שכבר בבעלותך או להשאיל ציוד באופן חד פעמי. 
                    </p>
                    </div>
                </div>
                </div>
            </div>
    );
};

export default Header;
